Columbia「コロンビア」PM3713 BOZEMAN ROCK JACKET「ボーズマンロックジャケット」２０１７年春夏新作モデルが入荷！薄手で軽く、シワになりにくいウインドジャケット。表面はオムニシールド機能により、小降りの雨やドロ汚れを弾きます。フードにはフィット感を片手で調節できるコードを備えています。右ポケットにウェア自体を収納できるパッカブル仕様です。キャンプやアウトドアトラベルなどに最適なモデルです。アウトドアシーンはもちろん、タウンユース、スポーツウェアとしても活躍間違いなしのアイテムです。
■素材：ポリエステル100%

