Columbia「コロンビア」PM3645 Hazen Jacket「ヘイゼン ジャケット」２０１７年春夏新作モデルが入荷！撥水性に優れ、シミ汚れを防ぐ防汚性の高い「OMNI-SHIELD」加工を施したナイロン素材。付属のバッグに収納して持ち運ぶことも可能なパッカブル仕様。アウトドアシーンはもちろん、タウンユース、スポーツウェアとしても活躍間違いなしのアイテムです。■素材：ナイロン100%
