Columbia「コロンビア」PM3644 Hazen Patterned Jacket「ヘイゼンパターンドジャケット」２０１７年春夏新作モデルが入荷！幅広いシーンで羽織りやすい軽量ジャケット。やわらかな表面は撥水性と防汚性があり、小雨などを防ぎます。内側はドライ感があり良好な肌触り。ウェアをコンパクトに収納できるスタッフバッグ付きで、持ち運びも便利です。
■素材：ポリエステル100%

