Columbia「コロンビア」KE3974 FLASHFORWARD WINDBREKER PRINT「フラッシュフォワードウィンドブレーカープリント ２０１７年春夏新作モデルが入荷！アウトドアシーン全般で活躍するオムニシールドを装備したジャケットです。比較的薄めの生地のウインドブレーカーですので、春先にピッタリのアイテムです。オムニシェイド加工で紫外線もカット！袖口はリブ状＆左右にジッパーポケット付き。 大変リーズナブルなプライスも魅力的です！。■素材：ポリエステル100%


